module.exports = /*#__PURE__*/JSON.parse('{"archive":{"blogPosts":[{"id":"/releases/9.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/9.0.0","source":"@site/blog/releases/9.0.0/index.mdx","title":"Release 9.0.0","description":"Migrera från 8.x.x till 9.0.0","date":"2025-05-08T00:00:00.000Z","tags":[],"readingTime":0.68,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 9.0.0","date":"2025-05-08T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"nextItem":{"title":"Release 8.0.0","permalink":"/pr-preview/pr-569/blog/releases/8.0.0"}},"content":"## Migrera från 8.x.x till 9.0.0\\n\\nStrukturen på tokens för `lineHeight` och `size` under `typography` har ändrats.\\nImporterar du dessa värden behöver du justera din kod enligt:\\n\\n### lineHeight\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n-   typography.lineHeight01\\n+   typography.lineHeight10\\n-   typography.lineHeight02\\n+   typography.lineHeight20\\n-   typography.lineHeight03\\n+   typography.lineHeight30\\n-   typography.lineHeight04\\n+   typography.lineHeight40\\n-   typography.lineHeight05\\n+   typography.lineHeight50\\n-   typography.lineHeight06\\n+   typography.lineHeight60\\n-   typography.lineHeight07\\n+   typography.lineHeight70\\n-   typography.lineHeight08\\n+   typography.lineHeight80\\n-   typography.lineHeight09\\n+   typography.lineHeight90\\n-   typography.lineHeight10\\n+   typography.lineHeight100\\n```\\n\\n### size\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n\\n-   typography.size01\\n+   typography.fontSize10\\n-   typography.size02\\n+   typography.fontSize20\\n-   typography.size03\\n+   typography.fontSize30\\n-   typography.size04\\n+   typography.fontSize40\\n-   typography.size05\\n+   typography.fontSize50\\n-   typography.size06\\n+   typography.fontSize60\\n-   typography.size07\\n+   typography.fontSize70\\n-   typography.size08\\n+   typography.fontSize80\\n-   typography.size09\\n+   typography.fontSize90\\n-   typography.size10\\n+   typography.fontSize100\\n\\n```\\n\\nKolla [changelog](/changelog/9.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/8.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/8.0.0","source":"@site/blog/releases/8.0.0/index.mdx","title":"Release 8.0.0","description":"Migrera från 7.x.x till 8.0.0","date":"2025-04-15T00:00:00.000Z","tags":[],"readingTime":0.54,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 8.0.0","date":"2025-04-15T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 9.0.0","permalink":"/pr-preview/pr-569/blog/releases/9.0.0"},"nextItem":{"title":"Release 7.0.0","permalink":"/pr-preview/pr-569/blog/releases/7.0.0"}},"content":"## Migrera från 7.x.x till 8.0.0\\n\\nVärdet i callbacken `onSelectionChange` för komponenten `Select` har ändrats.\\nNumera skickas valda nycklar med en `Selection` type (`\\"all\\" | Set<string | number>`) när användaren justerar sitt val.\\n\\n```diff\\n-   onSelectionChange?: ((value: Selection | Key | Key[]) => void) | undefined\\n+   onSelectionChange?: ((keys: Selection) => void) | undefined\\n```\\n\\nDetta innebär att du behöver hantera om användaren klickar på \\"Välj alla\\" manuellt:\\n\\n```tsx\\nconst handleSelectionChange = (keys: Selection) => {\\n  if (keys === \'all\') {\\n    return setSelection(new Set(options.map(({ id }) => id)))\\n  }\\n  return setSelection(keys)\\n}\\n```\\n\\nFör mer information, läs [instruktioner för `Select` och kontrollerade val](/components/select/#kontrollerade-val)\\n\\nKolla [changelog](/changelog/8.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/7.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/7.0.0","source":"@site/blog/releases/7.0.0/index.mdx","title":"Release 7.0.0","description":"Migrera från 6.x.x till 7.0.0","date":"2025-04-02T00:00:00.000Z","tags":[],"readingTime":0.27,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 7.0.0","date":"2025-04-02T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 8.0.0","permalink":"/pr-preview/pr-569/blog/releases/8.0.0"},"nextItem":{"title":"Release 6.0.0","permalink":"/pr-preview/pr-569/blog/releases/6.0.0"}},"content":"## Migrera från 6.x.x till 7.0.0\\n\\n`TextField` stödjer inte längre `validationType`.\\n\\n### pattern\\n\\nOm du vill använda HTML native constraint validation, använd egenskapen `pattern`.\\nLäs mer om [pattern på MDN](https://developer.mozilla.org/en-US/docs/Web/HTML/Reference/Elements/input#pattern)\\n\\n### validate\\n\\nFör anpassad validering med tillhörande felmeddelande, använd `validate`.\\nLäs mer om egenskapen under vår [dokumentation för TextField](/components/textfield/#egen-validering)\\n\\nKolla [changelog](/changelog/7.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/6.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/6.0.0","source":"@site/blog/releases/6.0.0/index.mdx","title":"Release 6.0.0","description":"- Vi påbörjar utfasning av Dialog, vänligen använd Modal istället.","date":"2025-03-24T00:00:00.000Z","tags":[],"readingTime":0.125,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 6.0.0","date":"2025-03-24T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 7.0.0","permalink":"/pr-preview/pr-569/blog/releases/7.0.0"},"nextItem":{"title":"Release 5.0.0","permalink":"/pr-preview/pr-569/blog/releases/5.0.0"}},"content":"- Vi påbörjar utfasning av `Dialog`, vänligen använd `Modal` istället.\\n- Vi påbörjar utfasning av `ModalTrigger`, vänligen använd `DialogTrigger` istället.\\n\\nKolla [changelog](/changelog/6.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/5.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/5.0.0","source":"@site/blog/releases/5.0.0/index.mdx","title":"Release 5.0.0","description":"Vi introducerar stöd för dark mode på samtliga komponenter","date":"2025-03-17T00:00:00.000Z","tags":[],"readingTime":0.07,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 5.0.0","date":"2025-03-17T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 6.0.0","permalink":"/pr-preview/pr-569/blog/releases/6.0.0"},"nextItem":{"title":"Release 4.0.0","permalink":"/pr-preview/pr-569/blog/releases/4.0.0"}},"content":"Vi introducerar stöd för dark mode på samtliga komponenter\\n\\nKolla [changelog](/changelog/5.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/4.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/4.0.0","source":"@site/blog/releases/4.0.0/index.mdx","title":"Release 4.0.0","description":"Migrera från 3.x.x till 4.0.0","date":"2025-03-10T00:00:00.000Z","tags":[],"readingTime":0.18,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 4.0.0","date":"2025-03-10T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 5.0.0","permalink":"/pr-preview/pr-569/blog/releases/5.0.0"},"nextItem":{"title":"Release 3.0.0","permalink":"/pr-preview/pr-569/blog/releases/3.0.0"}},"content":"## Migrera från 3.x.x till 4.0.0\\n\\n### Select\\n\\n`MultiSelect` ersätts av `Select`, vänligen använd `selectionMode` för en flerväljare:\\n\\n```tsx\\n<Select selectionMode=\'multiple\' />\\n```\\n\\nSe mer information om [hur du använder Select](/components/select)\\n\\nKolla [changelog](/changelog/4.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/3.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/3.0.0","source":"@site/blog/releases/3.0.0/index.mdx","title":"Release 3.0.0","description":"Migrera från 2.x.x till 3.0.0","date":"2025-02-28T00:00:00.000Z","tags":[],"readingTime":0.235,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 3.0.0","date":"2025-02-28T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 4.0.0","permalink":"/pr-preview/pr-569/blog/releases/4.0.0"},"nextItem":{"title":"Release 2.0.0","permalink":"/pr-preview/pr-569/blog/releases/2.0.0"}},"content":"## Migrera från 2.x.x till 3.0.0\\n\\n### SearchField\\n\\n`SearchField` stödjer inte längre `isRequired`. Beteendet kan efterliknas med hjälp av `validate`\\n\\n```tsx\\n<SearchField validate={v => !!v.length || \'Var god ange åtminstone ett tecken\' />\\n```\\n\\nSe mer information om [hur du använder SearchField](/components/search-field)\\n\\nKolla [changelog](/changelog/3.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/2.0.0","metadata":{"permalink":"/pr-preview/pr-569/blog/releases/2.0.0","source":"@site/blog/releases/2.0.0/index.mdx","title":"Release 2.0.0","description":"Migrera från 1.x.x till 2.0.0","date":"2025-02-25T00:00:00.000Z","tags":[],"readingTime":0.105,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 2.0.0","date":"2025-02-25T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 3.0.0","permalink":"/pr-preview/pr-569/blog/releases/3.0.0"}},"content":"## Migrera från 1.x.x till 2.0.0\\n\\n### TextField, TextArea\\n\\n`maxCharacters` byter namn till `maxLength` för enhetlighet\\n\\nKolla [changelog](/changelog/2.0.0)\\n\\n{/* truncate */}"}]}}');

